import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ExchangeData from './components/ExchangeData';
import MetadataData from './components/MetadataData';
import CandleData from './components/CandleData';

function App() {
  return (
    <Router>
      <div>

     

        {/* <nav>
          <ul>
            <li><Link to="/exchange">Exchange Data</Link></li>
            <li><Link to="/metadata">Metadata Data</Link></li>
            <li><Link to="/candle">Candle Data</Link></li>
          </ul>
        </nav> */}

        <Routes>
          <Route path="/exchange" element={<ExchangeData />} />
          <Route path="/metadata" element={<MetadataData />} />
          <Route path="/candle" element={<CandleData />} />
          <Route path="/" element={<div>Welcome to the Data App!</div>} /> {/* Default route */}
          <Route path="*" element={<div>404: Page Not Found</div>} /> {/* 404 route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
